function checkCashRegister(price, cash, cid) {
  const currencyUnits = [
    { name: "ONE HUNDRED", value: 100 },
    { name: "TWENTY", value: 20 },
    { name: "TEN", value: 10 },
    { name: "FIVE", value: 5 },
    { name: "ONE", value: 1 },
    { name: "QUARTER", value: 0.25 },
    { name: "DIME", value: 0.1 },
    { name: "NICKEL", value: 0.05 },
    { name: "PENNY", value: 0.01 },
  ];

  let changeDue = cash - price;
  let changeArray = [];
  let totalCashInDrawer = 0;

  const register = cid.reduce((acc, [name, amount]) => {
    acc[name] = amount;
    totalCashInDrawer += amount;
    return acc;
  }, {});

  totalCashInDrawer = Math.round(totalCashInDrawer * 100) / 100;

  if (totalCashInDrawer < changeDue) {
    return { status: "INSUFFICIENT_FUNDS", change: [] };
  }

  if (totalCashInDrawer === changeDue) {
    return { status: "CLOSED", change: cid };
  }

  for (let { name, value } of currencyUnits) {
    let amount = 0;
    while (register[name] > 0 && changeDue >= value) {
      changeDue -= value;
      register[name] -= value;
      amount += value;
      changeDue = Math.round(changeDue * 100) / 100;
    }
    if (amount > 0) {
      changeArray.push([name, amount]);
    }
  }

  if (changeDue > 0) {
    return { status: "INSUFFICIENT_FUNDS", change: [] };
  }

  return { status: "OPEN", change: changeArray };
}

